import logo from './logo.svg';
import './App.css';
import React from 'react';

function Btn() {
  return (
    <button style={{
      backgroundColor: "tomato",
      color: "white",
      padding: "10px 20px",
      border: 0,
      borderRadius: 10
    }}>Save Changes</button>
  )
}

function ConfirmBtn() {
  return <button style={{
    backgroundColor: "tomato",
    color: "white",
    padding: "10px 20px",
    border: 0,
    borderRadius: 10
  }}>Confirm</button>
}

function App() {
  return (
    <div>
      <Btn/>
      <Btn/>
    </div>
  );
}

export default App;
